import React from "react";
import { Button } from "react-bootstrap";
import EmployeData from "./EmployeData";

const EmployeTable = () => {
  const handleDelete = (id) => {
    var index = EmployeData.map((e) => {
      return e.id;
    }).indexOf(id);
    EmployeData.splice(index, 1);
  };
  return (
    <>
      <div className="table-responsive">
        <table className="table table-primary">
          <thead>
            <tr>
              <th scope="col">Name</th>
              <th scope="col">Position</th>
              <th scope="col">Action</th>
            </tr>
          </thead>
          <tbody>
            {EmployeData && EmployeData.length > 0
              ? EmployeData.map((items) => {
                  return (
                    <tr className="">
                      <td scope="row">{items.uname}</td>
                      <td>{items.position}</td>
                      <td>
                        <Button
                          className="me-3"
                          onClick={() => {
                            alert(items.id);
                          }}
                        >
                          Edit
                        </Button>
                        <Button onClick={() => handleDelete(items.id)}>
                          Delet
                        </Button>
                      </td>
                    </tr>
                  );
                })
              : "No Data Found"}
          </tbody>
        </table>
      </div>
    </>
  );
};

export default EmployeTable;
